import React, { useState, useCallback } from "react";
import ReactFlow, {
  MiniMap,
  Controls,
  Background,
  useNodesState,
  useEdgesState,
  MarkerType,
} from "reactflow";
import dagre from "dagre";
import "reactflow/dist/style.css";

const dagreGraph = new dagre.graphlib.Graph();
dagreGraph.setDefaultEdgeLabel(() => ({}));

const nodeWidth = 320;
const nodeHeight = 80;

// ---- DATA ----
const dependencies = [
  { view: "AudienceBuyerDaily", input: "BuyerETLVA1" },
  { view: "AudienceBuyerDaily", input: "BuyerETLVA2" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_5_pub_geo_aud_plat_ad_uid" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_6_pub_geo_aud_plat_ad_uid_url" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_3_aud_uid" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_4_geo_aud_uid" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_2_pub_aud_uid" },
  { view: "AudienceBuyerMonthly", input: "Audience_Gladiator_Daily_GrpSet_1_pub_geo_aud_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_1_pub_geo_aud_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_2_pub_aud_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_3_aud_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_4_geo_aud_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_5_pub_geo_aud_plat_ad_uid" },
  { view: "AudienceBuyerContextual", input: "Audience_Gladiator_Daily_GrpSet_6_pub_geo_aud_plat_ad_uid_url" },
  { view: "BuyerETLVA1", input: "FULL_RAW_ETL" },
  { view: "BuyerETLVA2", input: "FULL_RAW_ETL" },
  { view: "AudStoreMonthly", input: "AudStoreMonthlyLatestUsers" },
  { view: "AudStoreMonthlyPivotMySqlUpload", input: "AudStoreMonthly" },
  { view: "AudTrackerHourly", input: "RAW_AUD_TRACKER" },
  { view: "ComplexAudienceDaily", input: "AudStoreMonthlyLatestUsers" },
  { view: "DomainDataCardinalityReductionDaily", input: "ETL_VERIFIED_API" },
  { view: "AudienceDataCardinalityReductionDaily", input: "ETL_VERIFIED_API" },
  { view: "AudienceGladiatorCardinalityReductionDaily", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "DomainDataCardinalityReductionCoalesce", input: "DomainDataCardinalityReductionDaily" },
  { view: "AudienceDataCardinalityReductionCoalesce", input: "AudienceDataCardinalityReductionDaily" },
  { view: "AudienceDataCardinalityReductionCoalesce", input: "AudienceGladiatorCardinalityReductionDaily" },
  { view: "Audience_Gladiator_BuyerETLVA1", input: "FULL_RAW_ETL" },
  { view: "Audience_Gladiator_BuyerETLVA2", input: "FULL_RAW_ETL" },
  { view: "Audience_Gladiator_24HrsETL_Aggr", input: "Audience_Gladiator_BuyerETLVA1" },
  { view: "Audience_Gladiator_24HrsETL_Aggr", input: "Audience_Gladiator_BuyerETLVA2" },
  { view: "Audience_Gladiator_30DaysAudStore_Aggr", input: "AudStoreMonthlyLatestUsers" },
  { view: "Audience_Gladiator_ETL_Store_Join", input: "Audience_Gladiator_30DaysAudStore_Aggr" },
  { view: "Audience_Gladiator_ETL_Store_Join", input: "Audience_Gladiator_24HrsETL_Aggr" },
  { view: "AudStoreMonthlyLatestUsers", input: "AudStoreHourly" },
  { view: "AudStoreMonthlyLatestUsers", input: "AudStoreMonthlyLatestUsers" },
  { view: "AudStoreHourly", input: "AudStoreHourly" },
  { view: "AudStoreHourly", input: "RAW_AUD_LOGGER" },
  { view: "Audience_Gladiator_Daily_GrpSet_5_pub_geo_aud_plat_ad_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_6_pub_geo_aud_plat_ad_uid_url", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_3_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_4_geo_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_2_pub_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_1_pub_geo_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_5_pub_geo_aud_plat_ad_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_6_pub_geo_aud_plat_ad_uid_url", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_3_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_4_geo_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_2_pub_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
  { view: "Audience_Gladiator_Daily_GrpSet_1_pub_geo_aud_uid", input: "Audience_Gladiator_ETL_Store_Join" },
];

// ---- DAG LAYOUT ----
const getLayoutedElements = (nodes, edges) => {
  dagreGraph.setGraph({ rankdir: "LR" });

  nodes.forEach((node) => {
    dagreGraph.setNode(node.id, { width: nodeWidth, height: nodeHeight });
  });

  edges.forEach((edge) => {
    dagreGraph.setEdge(edge.source, edge.target);
  });

  dagre.layout(dagreGraph);

  nodes.forEach((node) => {
    const nodeWithPos = dagreGraph.node(node.id);
    node.position = {
      x: nodeWithPos.x - nodeWidth / 2,
      y: nodeWithPos.y - nodeHeight / 2,
    };
  });

  return { nodes, edges };
};

// ---- BUILD NODES & EDGES ----
const nodeIds = [...new Set(dependencies.flatMap((d) => [d.view, d.input]))];

const initialNodes = nodeIds.map((id) => ({
  id,
  data: { label: id },
  position: { x: 0, y: 0 },
  style: {
    padding: 10,
    borderRadius: 8,
    background: "linear-gradient(135deg, #ff9966 0%, #ff5e62 100%)",
    color: "white",
    fontSize: 13,
    fontWeight: 600,
    minWidth: nodeWidth,
    maxWidth: 420,
    height: nodeHeight,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    overflowX: "auto", // ðŸ‘ˆ scroll if too long
    whiteSpace: "nowrap",
  },
}));

const initialEdges = dependencies.map((d, i) => ({
  id: `e${i}`,
  source: d.input,
  target: d.view,
  animated: false,
  style: { stroke: "grey", strokeWidth: 2 },
  markerEnd: { type: MarkerType.ArrowClosed, color: "grey" },
}));

export default function App() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

  const { nodes: layoutedNodes, edges: layoutedEdges } =
    getLayoutedElements(nodes, edges);

  const onNodeClick = useCallback(
    (_, node) => {
      setEdges((eds) =>
        eds.map((e) => {
          if (e.target === node.id) {
            return {
              ...e,
              animated: true,
              style: {
                stroke: "red",
                strokeWidth: 4,
                strokeDasharray: "5 5",
              },
              markerEnd: { type: MarkerType.ArrowClosed, color: "violet" },
            };
          }
          return {
            ...e,
            animated: false,
            style: { stroke: "grey", strokeWidth: 2 },
            markerEnd: { type: MarkerType.ArrowClosed, color: "grey" },
          };
        })
      );
    },
    [setEdges]
  );

  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <ReactFlow
        nodes={layoutedNodes}
        edges={layoutedEdges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onNodeClick={onNodeClick}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background />
      </ReactFlow>
    </div>
  );
}
